import { SafeAreaView, Text } from "react-native";

export default function AboutUsPage() {
    return <SafeAreaView className="min-h-screen px-4 py-12">
    <Text className="m-2 ml-0 mt-4">
        About us
    </Text>
    </SafeAreaView>
}
